        return new Source("{% extends 'admin.html.twig' %}

{% block title %}Liste Plat{% endblock %}

{% block body %}
    <h1>Liste Plat </h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Libele</th>
                <th>Description</th>
                <th>Prix</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for plat in plats %}
            <tr>
                <td>{{ plat.id }}</td>
                <td>{{ plat.libele }}</td>
                <td>{{ plat.description }}</td>
                <td>{{ plat.prix }}</td>
                <td>
                    <a href=\"{{ path('plat_show', {'id': plat.id}) }}\">afficher</a>
                    <a href=\"{{ path('plat_edit', {'id': plat.id}) }}\">modifier</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"5\">aucun plat trouve</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('plat_new') }}\">Nouveau plat</a>
{% endblock %}
